import { __DATA__ } from "./data";
import {
  MainContainer,
  BarContainer,
  BarChartContainer,
  Number,
  BlackLine,
  MakeBar
} from "./styles";
import Slider from "./slider.js";
import Container from '@mui/material/Container';
import Stack from '@mui/material/Stack';

export default function App() {
  return (
    <>
    <Stack spacing={2} alignItems="center">
      <Slider/> 
    </Stack>
    </>
  );
}
